import React from "react";
import ReactDOM from "react-dom";


function Card(Props){
    <div>
    <h2>{Props.name}</h2>
    <img
      src={Props.img}
      alt="avatar_img"
    />
    <p>{Props.phone_no}</p>
    <p>{Props.email}</p>
    </div>
}

ReactDOM.createRoot( document.getElementById("root")).render(
  <div>
    <h1>My Contacts</h1>
    <Card name="Beyonce" img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" phone_no= "+123 456 789" email= "b@beyonce.com" />
    
  </div>
 
);
